import React from 'react';
import Navbar from "./Components/Navbar";
import {BrowserRouter as Router, Route} from "react-router-dom";
import Home from "./Components/Home"

import './App.css';
function App() {

  return (
    <Router>
      <Navbar/>
      <Route exact path = "/" component = {Home}/>
    </Router>
  );
}

export default App;
